//base
import React, { Fragment } from "react";

//material ui
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import { createTheme, ThemeProvider, styled } from '@mui/material/styles';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import { Container, Typography } from "@mui/material";
const styles = (muiBaseTheme) => ({
    card: {
      maxWidth: 300,
      margin: "auto",
      transition: "0.3s",
      boxShadow: "0 8px 40px -12px rgba(0,0,0,0.3)",
      "&:hover": {
        boxShadow: "0 16px 70px -12.125px rgba(0,0,0,0.3)"
      }
    },
    content: {
      textAlign: "left",
      padding: muiBaseTheme.spacing.unit * 3
    },
    center: {
      display: "flex",
      justifyContent: "center"
    },
    mb2: {
      marginBottom: muiBaseTheme.spacing.unit * 2
    },
    heading: {
      fontWeight: "bold"
    },
    subheading: {
      lineHeight: 1.8
    },
    or: {
      position: "relative",
      marginBottom: "10px",
      "&:before, &:after": {
        content: "''",
        display: "inline-block",
        height: "1px",
        width: "40%",
        background: "#00000044",
        position: "absolute",
        top: "50%"
      },
      "&:before": {
        transform: "translate(-70%, -50%)"
      },
      "&:after": {
        transform: "translate(70%, -50%)"
      }
    }
  });
const Logbook = () => {
    return (
        <Fragment>
            <CssBaseline />
            <Box sx={{ bgcolor: '#f7f5f0', height: '100vh' }}>
                <Container>
                    <Grid container paddingTop={15} paddingLeft={5} >
                        <Typography variant="h4" component="div" style={{ fontWeight: 600 }} gutterBottom>
                            Form Pengguna
                        </Typography>
                    </Grid>
                    <Grid container paddingLeft={5}>
                        <Card sx={{ minWidth: 275, width: '100%' }} >
                        <div className="hr">OR</div>
                            <CardContent>
                                <Typography sx={{ fontSize: 14 }} gutterBottom>
                                  Nama Lengkap
                                </Typography>
                            </CardContent>
                            <CardActions>
                                <Button size="small">Learn More</Button>
                            </CardActions>
                        </Card>
                    </Grid>
                </Container>
            </Box>
        </Fragment>
    )
}

export default Logbook;
